import React from 'react'

const ClearAll = () => {
    alert("jopa");
}

const ClearAllTodos = () => {
  return (
    <div>
        <button onClick={() => ClearAll} className='border text-3xl text-white'>
            Clear
        </button>
    </div>
  )
}

export default ClearAllTodos
